export default function Orders() {
  const [data, setData] = useState([]);
const fetchData = () => {
  fetch(`http://localhost:1337/api/fileinfos`)
    .then((response) => response.json())
    .then((actualData) => {
      console.log(actualData.data);
      //setData(actualData.data);
     // console.log(data);
    })
    .catch((err) => {
      console.log(err.message);
