};
useEffect(() => {
  fetchData();
}, []);



  return (
    <React.Fragment>
      <Title>Recent Orders</Title>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>CID</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Type</TableCell>
            {/* <TableCell align="right">Sale Amount</TableCell> */}
